        #endregion
        #region Properties


        private string _locationName;
        public string LocationName { get => _locationName; set { _locationName = value; OnPropertyChanged(); } }

        private string _locationProvince;
        public string LocationProvince { get => _locationProvince; set { _locationProvince = value; OnPropertyChanged(); } }

        private string _locationDescription;
        public string LocationDescription { get => _locationDescription; set { _locationDescription = value; OnPropertyChanged(); } }

        private byte[] _imageCover;
        public byte[] ImageCover { get => _imageCover; set { _imageCover = value; OnPropertyChanged(); } }


        public Global globalTheme = Global.GetInstance();

        public ICommand ChangeShow { get; set; }
        public ICommand LoadedWindowCommand { get; set; }
        public int ProgressBarValue { get => _progressBarValue; set { _progressBarValue = value; OnPropertyChanged(); } }
        #endregion
        public SplashScreenViewModel()
        {

            if (DataProvider.Ins.DB.Locations.Count() == 0)
            {
                ImageCover = System.Text.Encoding.Default.GetBytes(_defaultImage);
            }
            else
            {
                Location location;
                int limit = 100;
                do
                {
                    limit--;
                    location = DataProvider.Ins.DB.Locations.ToList()[MyRandom.Ins.Next(DataProvider.Ins.DB.Locations.ToList().Count())];
                } while (limit > 0 && location.ImageBytes == null);
                LocationName = location.Name;
                LocationProvince = location.Province.Name;
                LocationDescription = location.Description;
                ImageCover = (location.ImageBytes != null) ? location.ImageBytes : System.Text.Encoding.Default.GetBytes(_defaultImage);
            }

            ChangeShow = new RelayCommand<object>((prop) => { return true; }, (prop) =>
            {
                var value = ConfigurationManager.AppSettings["ShowSplashScreen"];
                bool showSplash = bool.Parse(value);
                var config = ConfigurationManager.OpenExeConfiguration(
                ConfigurationUserLevel.None);
                config.AppSettings.Settings["ShowSplashScreen"].Value = (!showSplash).ToString();
                config.Save(ConfigurationSaveMode.Minimal);

                ConfigurationManager.RefreshSection("appSettings");
            });

            LoadedWindowCommand = new RelayCommand<Window>((prop) => { return true; }, (splash) =>
            {
                
                splash.Hide();
                var value = ConfigurationManager.AppSettings["ShowSplashScreen"];
                bool showSplash = bool.Parse(value);
                if (showSplash == false)
                {
                    if (MainViewModel.IsShowed == false)
                    {
                        MainWindow mW = new MainWindow();
                        mW.Show();
                        MainViewModel.IsShowed = true;
                    }
                    splash.Close();
                }
                else
                {
                    splash.Show();
                    dT.Elapsed += dt_Tick;
                    dT.Start();
                }

            });
        }

        void dt_Tick(object sender, EventArgs e)
        {
            ProgressBarValue += Interval;
            if (ProgressBarValue >= _time_SplashScreen)
            {
                dT.Dispose();
                //thisWindow.Close();
                //MainWindow mW = new MainWindow();
                //mW.Show();
            }
            else
            {
                dT.Start();
            }

        }



    }
